      const players = []
      axios.get('https://project.trumedianetworks.com/api/nfl/players', {
    headers: {
      'tempToken': '690ea364-8913-4859-b3c7-567a9e1bc3cb',
    }
  })
  .then(response => response.json())
        .then(function (result) {
          result.forEach((res,index)=> {
            games.push(
              <div class="cards">
